import React from "react";
import "../Principal.css"; // aquí pondrás tu CSS

export default function Vista1() {
  return (
    <div className="vista1">
      {/* Banner */}
      <header className="banner">
        <img src="/image.png" alt="Logo" className="logo" />
        <h1 className="titulo">Red ELEAM</h1>
        <button className="btn-login">Iniciar Sesión</button>
      </header>

      {/* Texto */}
      <h2 className="personal-turno">Personal de turno:</h2>

      {/* Funcionarios */}
      <div className="funcionarios">
        <div className="card">Funcionario 1</div>
        <div className="card">Funcionario 2</div>
        <div className="card">Funcionario 3</div>
        <div className="card">Funcionario 4</div>
      </div>

      <div className="funcionarios">
        <div className="card">Funcionario 5</div>
        <div className="card">Funcionario 6</div>
        <div className="card">Funcionario 7</div>
        <div className="card">Funcionario 8</div>
      </div>
    </div>
  );
}
